article_content:
가격이 저렴해서 별하나,배송이 빨라서 별둘.
이렇게 해서 별 두개입니다.

색은 화면과 많이 다름니다.
화면을 밝게 처리한 것 같네요.
아이보리라기보다는 옅은 배이지네요;;;
젠장;; 색이 이럴 줄 알았으면 그냥 짙은 색을 구매할 것을;;;
저렴해서 좋다 생각했는데...
저렴한 가격임에도 사진보고 기대를 한 제가 잘못이겠죠;;
박스가 1도 튼튼하지않아요;;
게다가 뚜껑보시면;;; 모서리가 흐믈떡;;;
아 다떠나서 전 색상때문에 짜증이나네요;;
누런색이에요 누런색 때가 탄 듯한 누런;;
화면과 색상이 다르다는 이유로 반품하고 싶은데 귀찮아서 그냥 씁니다;;
제라 올린 사진도 실물보다 밝게 나온 편이니 참고하세요

원래쓰던제품이라 추가로 구입함.
같은 상호의 제품이 로켓에 떠서 주문했는데... 다르네요;;
색상도 한톤 회빛으로 다운되고 두께도 달라요..
별로에요;;
